import React from 'react';
import './Courses.css';
import Dropdown from '../components/Dropdown'

function App() {
  return (
    
    <div className="App">
      {/* Main Content */}
      <div className="main-content">
        {/* Title */}
        <header className="App-header">
          <h1 className="title">
            <span style={{ color: '#FF007F' }}>Your</span>{' '}
            <span style={{ color: '#007FFF' }}>Courses</span>
          </h1>
        </header>
        <Dropdown/>
        
    </div>
  </div>
  );
}

export default App;
